    marked = set()

    # Function to check if a row has all same characters and length >= 2
    def mark_row(row_idx):
        row = grid[row_idx]
        if len(row) < 2:
            return
        if all(c == row[0] for c in row):
            for j in range(len(row)):
                marked.add((row_idx, j))

    # Function to check if a column has all same characters and length >= 2
    def mark_col(col_idx):
        if len(grid) < 2:
            return
        first_char = grid[0][col_idx]
        for i in range(1, H):
            if grid[i][col_idx] != first_char:
                return
        for i in range(H):
            marked.add((i, col_idx))

    # Iterate until no more marks are found
    while True:
        # Mark rows
        for i in range(H):
            mark_row(i)
        # Mark columns
        for j in range(W):
            mark_col(j)
        # If no marks, break
        if not marked:
            break
        # Remove marked cells
        for (i, j) in marked:
            grid[i][j] = '.'  # Mark as removed
        marked = set()

