        def flip_range(self, a, b, node=1, l=0, r=None):
            if r is None:
                r = self.size - 1
            if a > r or b < l:
                return
            if a <= l and r <= b:
                self.tree[node] = (r - l + 1) - self.tree[node]
                self.lazy[node] ^= 1
                return
            self.push(node, l, r)
            mid = (l + r) // 2
            self.flip_range(a, b, 2 * node, l, mid)
            self.flip_range(a, b, 2 * node + 1, mid + 1, r)
            self.tree[node] = self.tree[2 * node] + self.tree[2 * node + 1]

        def get_value(self, idx, node=1, l=0, r=None):
            if r is None:
                r = self.size - 1
            if l == r:
                return self.tree[node]
            self.push(node, l, r)
            mid = (l + r) // 2
            if idx <= mid:
                return self.get_value(idx, 2 * node, l, mid)
            else:
                return self.get_value(idx, 2 * node + 1, mid + 1, r)

    class TransitionSegmentTree:
        def __init__(self, data):
            self.n = len(data)
            self.size = 1
            while self.size < self.n:
                self.size <<= 1
            self.tree = [0] * (2 * self.size)
            for i in range(self.n):
                self.tree[self.size + i] = data[i]
            for i in range(self.size - 1, 0, -1):
                self.tree[i] = self.tree[2 * i] + self.tree[2 * i + 1]

        def push(self, node, l, r):
            pass

        def update(self, a, b, node=1, l=0, r=None):
            if r is None:
                r = self.size - 1
            if a > r or b < l:
                return
            if a <= l and r <= b:
                self.tree[node] = (r - l + 1) - self.tree[node]
                return
            mid = (l + r) // 2
            self.update(a, b, 2 * node, l, mid)
            self.update(a, b, 2 * node + 1, mid + 1, r)
            self.tree[node] = self.tree[2 * node] + self.tree[2 * node + 1]

        def query(self, a, b, node=1, l=0, r=None):
            if r is None:
                r = self.size - 1
            if a > r or b < l:
                return 0
            if a <= l and r <= b:
                return self.tree[node]
            mid = (l + r) // 2
            left = self.query(a, b, 2 * node, l, mid)
            right = self.query(a, b, 2 * node + 1, mid + 1, r)
            return left + right

    data_list = [int(c) for c in S]
    st = SegmentTree(data_list)
    transitions = [0] * (N - 1)
    for i in range(N - 1):
