import sys
import math
from collections import defaultdict

def count_square_free_form(a):
    if a == 0:
        return 0
    square_free = a
    for i in range(2, int(math.isqrt(square_free)) + 1):
        count = 0
        while square_free % (i * i) == 0:
            square_free //= (i * i)
            count += 1
    return square_free

def main():
    input = sys.stdin.read
    data = input().split()
    N = int(data[0])
    A = list(map(int, data[1:N+1]))

    freq = defaultdict(int)
    for num in A:
        sf = count_square_free_form(num)
        freq[sf] += 1

    result = 0
    for count in freq.values():
        if count >= 2:
            result += count * (count - 1) // 2

    print(result)

if __name__ == "__main__":
    main()

